F.b.detectSubfile="Determines whether Genie should look for subfiles on each screen.  The default value is true.";F.b.detectSubfilePatterns="This flag tells Genie to look for a subfile by detecting a pattern of rows that are formatted in the same way.  When a subfile is detected using this method, a grid widget is created over it.  If the flag is not set to true, Genie looks for Option Headings, instead, in order to detect the subfile.";F.b.detectSubfileEndPlus="When \"detect subfile patterns\" is selected, this flag will allow Genie to recognize a 1A output field usually containing a '+' on the end of the last row, and remove it so that it will not interrupt the pattern detection. The default value for this property is true.";
F.b.findOptionColumn='When "Detect Subfile Patterns" is selected, this flag is used to prevent false positives by only creating grids on subfiles where an Option Column exists.';F.b.pagingBar='When "Detect Subfile Patterns" is selected and this flag is set to "true", the subfile grid widget will include a paging bar. When set to "false" a paging scrollbar will be used. The default value is "false".';F.b.optionHeadings='Specifies a comma separated list of headings to look for to identify a subfile option column.  This method of detecting subfiles is used only when the "Detect Subfile Patterns" option is not selected.  The default value for this property is OPT,SEL.';
F.b.outlineSubfile="If a subfile is found using the Option Headings method, this flag determines whether an outline is drawn around the subfile area.";F.b.subfileOutlineColor='Sets the outline color when the "Outline Subfiles" option is used. This can be give either as a CSS color name, such as "red", or as a hex code, such as "#FF0000". The default color is "yellow".';F.b.separateSubfileLines="If a subfile is found using the Option Headings method, this flag determines whether a separator line is drawn between each subfile line.";
F.b.hideSubfileOpt="If a subfile is found using the Option Headings method, this flag tells Genie to find and hide an option input box on each subfile line.  Instead of using the input box, the user will be able to right-click the subfile to select the appropriate option.";F.b.stripedSubfile="Determines if the subfile rows are striped with alternate colors.";F.b.oddRowColor="The color of the odd rows in a striped subfile.";F.b.evenRowColor="The color of the even rows in a striped subfile.";
F.b.hiColor="Defines the color of the row when it is hovered over with the mouse.";F.b.hiFontColor="Defines the color of the text within the row when the row is hovered over with the mouse.";F.b.multX="Controls the horizontal spacing between fields. The field's column number is multiplied by this number to derive the pixel offset from the left edge of the 5250 area.";F.b.multY="Controls the vertical spacing between fields. The field's row number is multiplied by this number to derive the pixel offset from the top edge of the 5250 area.";
F.b.inputPadding="Extra width (in pixels) to assign to input fields. This can be used to adjust for input field border styling, variations in font rendering, etc. Defaults to 4 if not specified.";F.b.alertErrors="When set to true, Genie presents green-screen errors in an alert box.  When set to false, errors are displayed at the bottom of the screen only.";F.b.detectDateFields="When set to true, Genie looks for date fields on this screen and automatically attaches a calendar control to any field that it finds.";
F.b.defaultDateFormat="Defines the default date format to be used in calendar controls.";F.b.locale="Defines a locale that can be used to control various settings. Currently, only the text display for month and day names on the calendar widget is affected by this setting.";F.b.detectMenus="When set to true, Genie will attempt to detect menu panels and transform the menu options into hyperlinks. The default value is true.";F.b.enlargeHeadings="When set to true, Genie looks for the screen heading and automatically increases its font size and adds a shadow.";
F.b.functionKeyButtons='Determines whether function key labels, such as "F3=Exit", are transformed into buttons.';F.b.hideFKeyNames='Tells Genie to look for function key labels and remove the function key name.  For example, "F3=Exit" becomes "Exit".  The user will be able to click on the field to send the appropriate function key to the server.';F.b.overtypeMode='Determines if the default keyboard cursor mode is overtype or insert.  In overtype mode, the characters you type replace existing characters one by one.  In insert mode, the characters you type move existing text to the right.  The default value is true. Note that this functionality will only work in Internet Explorer. For similar functionality in other browsers, we suggest using the "Highlight On Focus" option.';
F.b.highlightOnFocus="Highlights text in input fields when focus is received.  The default value is false.";F.b.preventAutoTab="If set to false, Genie overrides the browser's default behavior of the Tab key with its own automatic tabbing.  If set to true, the browser's default behavior is used for tabbing.  The default value is false.";F.b.setFieldBackground="If set to true, Genie will set the background color of all fields to the match the main screen background color, preventing any underlying items from showing through. If set to false, all fields will be given a transparent background, allowing any underlying items to show through. The default value is false.";
F.b.useFixedFont="If set to true, Genie will set the font for all screens to Monospace. If set to false, Genie will use the font specified in the style sheet for this skin. The default value is false.";F.b.detectWindowBorder="If set to true, Genie will detect window border fields (such as a string of dots) and apply the browser's default monospace font to them. The default value is true.";F.b.autoSizeFont="When set to true, Genie will automatically adjust the font size and spacing when the size of the browser window changes.";
F.b.browserAutoComplete="When set to true, Genie will enable the browser to store previous form entries and suggest matches for the user as they type.  The default value is false.  The Auto Complete feature (also known as the Auto Fill feature in some browsers) must be enabled within browser settings.  If this feature is enabled, Overtype Mode should be set to false.";F.b.adjustWindowBorders="When set to true, Genie will adjust the position and height of reverse image/space window borders in order to prevent gaps in the border. The default value is true.";
